css:
@-moz-document domain("developer.apple.com") {
body {
  background: #000000;
  color: #FFFFFF;
}

  
code {
  color: #00FF00;
}

h1#pageTitle {
  color: #FFFF00;
}

h2.jump {
  color: #00CC99;
}

h3.tight, h3.jump, h3.function {
  color: #00CCFF;
}

h3.tasks {
  color: #00CC99;
}

h3.constantGroup {
  color: #0099CC;
}

h5 {
  color: #00CCff;
}

h5.tight {
  color: #00CCff;
}

div.importantbox, div.clear {
  background: #333333;
  color: #FF3333;
}

div.spec_sheet_info_box, table.specbox {
  background #333333;
}

ul#toc {
  color: #006699;
}

ul#toc li span.sectionName a {
  color: #669999 !important;
}

.codesample table {
  background: #333333;
}

code, tt, samp, pre {
  color: #00FF00;
}

.specbox, td {
  background: #333333;
  color: #CCCCCC;
}
  
nav#tocContainer {
  background: #333333;
  color: #FFFF00;
}

div.notebox {
  background: #333333;
}

aside {
  background: #333333;
  color: #CC0000;
}
}
